import React from 'react';
import { motion } from 'framer-motion'; 

const Stats = ({ selectedYear, stats}) => {
  return (
    <div className="container mx-auto p-8">
      <h1 className="text-4xl font-bold mb-8">Stats</h1>

      <div className="flex items-center mb-4">
        <label className="mr-2">Select Year:</label>
        <select className="p-2 border rounded">
          {/* Populate options based on available years */}
          <option value="2022">2022</option>
          <option value="2023">2023</option>
          {/* Add more years as needed */}
        </select>
      </div>

      <motion.div animate={{y: 100}}className="border p-4 rounded">
        <h2 className="text-2xl font-bold mb-4">Stats for {selectedYear}</h2>

        {/* Display runner stats here */}
        <p>Total Distance: {stats.distance} miles</p>
        <p>Total Time: {stats.time} hours</p>
        {/* Add more stats as needed */}
      </motion.div>
    </div>
  );
};

export default Stats;
